- Enriched OpenStreetMap (OSM) maps - Free to download and use at any time;
- Full voice guidance with spoken street names;
- Automatic rerouting as traffic conditions change on the road;
- One-box search: find everything faster;
- Voice search;
- Choose where to go for dinner, learn about the prices and reviews and make a reservation while getting the directions;
- Lane assistance for those complex highway exits;
- Several alternatives for each calculated route;
- Find a parking spot as soon as you reach your destination;
- Find and navigate to any point on the map or contact stored on your phone;
- Send your estimated time of arrival to those you’re meeting;
- Walking directions & tourist attractions;
- More incredible features to come in the next updates.

